import React from 'react'
import { NextPageContext } from 'next';
import Head from 'next/head';

type IndexProps = {
        name?: string;
}

export default function Index(props: IndexProps) {
    console.log('[Index] ' + JSON.stringify(props));
    const { title } = props;
    const hello = `안녕! Nest with Next ${title}`;
    return (
        <>
            <Head><title>뉴타이틀</title></Head>
            <div>
                ${hello}
            </div>
        </>
    )
}

Index.getInitialProps = async function (context: NextPageContext) {
    console.log("[DEBUG] path: " + context.pathname);

    const { query } = context;
    console.log("[DEBUG] 받음" + JSON.stringify(query));
    return { query };
}
